/**
 * Returns the relative positions of terms in this phrase.
 */
public int[] getPositions() {
  int[] result = new int[positions.size()];
  for (int i = 0; i < positions.size(); i++)
    result[i] = ((Integer) positions.elementAt(i)).intValue();
  return result;
}

